  productName,
  productDescription,
  tryDemo,
  learnMore,) {
    return (  
        <div className='container p-5 mt-5'>
        <div className='col-6'>
            <h1>Console</h1>
            <p className='p-3'>The central dashboard for your Zerodha<br/> account. Gain insights into your trades and<br/> investments with in-depth reports and <br/>visualisations.</p>
            <a href='' style={{textDecoration:"none"}}>Learn More</a>
        </div>
        <div className='col-6'>
            <img src='media/console.png'/>
        </div>
        </div>
    );
}

export default RightSection;
